import React from "react";
import logo from "../../assets/logo.png";
// import "font-awesome/css/font-awesome.min.css";

const Header = () => {
  return (
    <div>
      <div>
        <img src={logo}></img>
        <p>Login</p>
        <i className="fas fa-shopping-cart"></i> Cart
      </div>
      <input></input>
    </div>
  );
};

export default Header;
